        <img src="images/img-14.jpg" class="center" width={200} height={300} ></img>
        <br></br>

        <p><center>

        The Perpetual Foreigner stereotype is harmful because it 
        assumes that individuals who are racially or ethnically
        different from the majority population are not truly American,
        regardless of how long they have lived in the United States.
        This stereotype erases the experiences of individuals who have 
        grown up in the United States and view themselves as American.
        It also perpetuates the idea that individuals who are racially 
        or ethnically different are not fully integrated into American 
        society and therefore not entitled to the same rights and privileges
        as other Americans. This can lead to discrimination in areas such as 
        employment, housing, and education, and can create a sense of alienation
        and marginalization for those wo are targeted by this stereotype.

        </center>
        </p>
      </div>





   </div>

